  "instructions": "<p>It's a small spawn for lower level knights, not very popular.</p>\n<p></p>\n<p>This spawn definitely isn't for PG since it's not that big but it's somewhere new to hunt if you're bored of the usual areas and want to experience somewhere new.</p>\n<p></p>\n<p>You can make up to 160k xp/h on green stamina (tested with 92 sword fighting). Recommended at least level 35 to use exori.</p>\n<p></p>\n<p>üí∞<strong> Loot</strong></p>\n<p>In order to profit here you're going to have to pick up all the gold and creature products that drop. Consider bringing a larger backpack or a Zaoan Chess Box, it will make looting easier.</p>\n<p></p>\n<p>If you have lower skills or is finding it hard to make money here you can try cutting out some exoris and focus more on hunting one by one.</p>\n<p></p>\n<p>üõ°Ô∏è<strong> Equipment</strong></p>\n<p>The equipment you'll want to bring here is just your usual equipment, the more armor the better.</p>\n<p></p>\n<p>If you're a low-level funded by your main, wear some soft boots benefit you a lot at this level, with a small mana pool, and free up a lot of cap from the potions you save.</p>\n<p></p>\n<p>Bring around 150 mana potions (save some cap for looting gold and the items that coryms</p>\n<p>drop) and 20~ strong health potions for emergencies.</p>\n<p></p>\n<p>üó∫Ô∏è<strong> Route</strong></p>\n<p>The route starts out going down the staircase and then heads into each individual room.</p>\n<p>Once you clear all the floors, then head back to the top and work your way down again.</p>\n<p></p>\n<p>Rather than killing the monsters one by one, you should run right into the middle of the room and exori a big group. Then finish the ranged monsters and the other monsters that run in low health.</p>\n<p></p>\n<p>üêó<strong> Task</strong></p>\n<p>You can take the Minotaur task before coming here if you want to get a few kills toward, but as you really only get like 20 kills per hunt, it's not the end of the world if you don't start the task.</p>",
